import React from "react";
import ";/janela.css";

function Janela({ dados }) {
  return (
    <div className="janela">
      {/* Exibe os dados formatados se estiverem disponíveis */}
      {dados && (
        <div>
          <h2>Informações do Cliente</h2>
          <pre>{JSON.stringify(dados, null, 2)}</pre>
        </div>
      )}
    </div>
  );
}

export default Janela;
